import React,{Component} from 'react';
import {render} from 'react-dom';

class Form extends Component{
   render(){
       return(
              <Form>
                  <div>
                      <label>username: </label>
                      <input type="text"/>
                  </div>
              </Form>
       )
   }
}

export default Form;
